public class Solution {
    public int getNumberOfBacklogOrders(int[][] orders) {
        final long MOD = 1_000_000_007L;
        // Max-heap for buy orders (highest price first)
        PriorityQueue<long[]> buy = new PriorityQueue<>(new Comparator<long[]>() {
            public int compare(long[] a, long[] b) {
                return Long.compare(b[0], a[0]); // descending by price
            }
        });
        // Min-heap for sell orders (lowest price first)
        PriorityQueue<long[]> sell = new PriorityQueue<>(new Comparator<long[]>() {
            public int compare(long[] a, long[] b) {
                return Long.compare(a[0], b[0]); // ascending by price
            }
        });

        for (int[] order : orders) {
            long price = order[0];
            long amount = order[1];
            int type = order[2];

            if (type == 0) { // buy order
                while (amount > 0 && !sell.isEmpty() && sell.peek()[0] <= price) {
                    long[] s = sell.peek();
                    long trade = Math.min(amount, s[1]);
                    amount -= trade;
                    s[1] -= trade;
                    if (s[1] == 0) {
                        sell.poll();
                    }
                }
                if (amount > 0) {
                    buy.offer(new long[]{price, amount});
                }
            } else { // sell order
                while (amount > 0 && !buy.isEmpty() && buy.peek()[0] >= price) {
                    long[] b = buy.peek();
                    long trade = Math.min(amount, b[1]);
                    amount -= trade;
                    b[1] -= trade;
                    if (b[1] == 0) {
                        buy.poll();
                    }
                }
                if (amount > 0) {
                    sell.offer(new long[]{price, amount});
                }
            }
        }

        long total = 0;
        while (!buy.isEmpty()) {
            total = (total + buy.poll()[1]) % MOD;
        }
        while (!sell.isEmpty()) {
            total = (total + sell.poll()[1]) % MOD;
        }
        return (int) total;
    }
}

