public class Solution {

    public int minFlips(String expression) {
        Node root = parse(expression);
        int original = eval(root);
        int[] dp = compute(root);
        int target = original == 1 ? 0 : 1;
        return dp[target];
    }

    /* ---------- Parsing ---------- */

    private Node parse(String s) {
        int[] idx = new int[1];
        return parseExpr(s, idx);
    }

    private Node parseExpr(String s, int[] idx) {
        Node left = parseFactor(s, idx);
        while (idx[0] < s.length()) {
            char c = s.charAt(idx[0]);
            if (c == '&' || c == '|') {
                idx[0]++; // consume operator
                Node right = parseFactor(s, idx);
                left = new Node(c, left, right);
            } else {
                break;
            }
        }
        return left;
    }

    private Node parseFactor(String s, int[] idx) {
        char c = s.charAt(idx[0]);
        if (c == '(') {
            idx[0]++; // consume '('
            Node inside = parseExpr(s, idx);
            if (idx[0] < s.length() && s.charAt(idx[0]) == ')') {
                idx[0]++; // consume ')'
            }
            return inside;
        } else { // operand
            idx[0]++; // consume operand
            return new Node(c);
        }
    }

    /* ---------- Evaluation ---------- */

    private int eval(Node node) {
        if (node.isLeaf) {
            return node.val;
        }
        int leftVal = eval(node.left);
        int rightVal = eval(node.right);
        return node.op == '&' ? (leftVal & rightVal) : (leftVal | rightVal);
    }

    /* ---------- DP for minimal flips ---------- */

    private int[] compute(Node node) {
        if (node.isLeaf) {
            int[] res = new int[2];
            res[0] = node.val == 0 ? 0 : 1; // cost to make 0
            res[1] = node.val == 1 ? 0 : 1; // cost to make 1
            return res;
        }

        int[] left = compute(node.left);
        int[] right = compute(node.right);
        int[] res = new int[2];
        final int INF = Integer.MAX_VALUE / 2;
        res[0] = res[1] = INF;

        for (int target = 0; target <= 1; target++) {
            // original operator
            res[target] = Math.min(res[target],
                    costForOp(node.op, left, right, target, 0));
            // flipped operator
            char flipped = node.op == '&' ? '|' : '&';
            res[target] = Math.min(res[target],
                    costForOp(flipped, left, right, target, 1));
        }
        return res;
    }

    private int costForOp(char op, int[] left, int[] right, int target, int flipCost) {
        int best = Integer.MAX_VALUE / 2;
        for (int l = 0; l <= 1; l++) {
            for (int r = 0; r <= 1; r++) {
                int val = (op == '&') ? ((l == 1 && r == 1) ? 1 : 0)
                                       : ((l == 1 || r == 1) ? 1 : 0);
                if (val == target) {
                    int cost = left[l] + right[r] + flipCost;
                    if (cost < best) best = cost;
                }
            }
        }
        return best;
    }

    /* ---------- Node definition ---------- */

    private static class Node {
        boolean isLeaf;
        int val;          // for leaf: 0 or 1
        char op;          // for operator: '&' or '|'
        Node left, right;

        Node(char leafVal) {
            this.isLeaf = true;
            this.val = leafVal - '0';
        }

        Node(char op, Node left, Node right) {
            this.isLeaf = false;
            this.op = op;
            this.left = left;
            this.right = right;
        }
    }

    /* ---------- Result class (optional) ---------- */

    public static class Result {
        public int val;
        public int minFlips;

        public Result(int val, int minFlips) {
            this.val = val;
            this.minFlips = minFlips;
        }
    }
}

