import java.util.ArrayDeque;
import java.util.Deque;

public class Solution {
    public int getMinSwaps(String num, int k) {
        char[] target = num.toCharArray();
        for (int t = 0; t < k; t++) {
            if (!nextPermutation(target)) {
                // According to problem statement this should not happen
                break;
            }
        }
        String targetStr = new String(target);
        return minAdjacentSwaps(num, targetStr);
    }

    private boolean nextPermutation(char[] a) {
        int n = a.length;
        int i = n - 2;
        while (i >= 0 && a[i] >= a[i + 1]) i--;
        if (i < 0) return false;
        int j = n - 1;
        while (a[j] <= a[i]) j--;
        swap(a, i, j);
        reverse(a, i + 1, n - 1);
        return true;
    }

    private void swap(char[] a, int i, int j) {
        char tmp = a[i];
        a[i] = a[j];
        a[j] = tmp;
    }

    private void reverse(char[] a, int l, int r) {
        while (l < r) {
            swap(a, l, r);
            l++;
            r--;
        }
    }

    private int minAdjacentSwaps(String source, String target) {
        int n = source.length();
        Deque<Integer>[] pos = new ArrayDeque[10];
        for (int d = 0; d < 10; d++) pos[d] = new ArrayDeque<>();
        for (int i = 0; i < n; i++) {
            pos[source.charAt(i) - '0'].add(i);
        }

        Fenwick bit = new Fenwick(n);
        int swaps = 0;
        for (int i = 0; i < n; i++) {
            int d = target.charAt(i) - '0';
            int idx = pos[d].poll();
            int removedBefore = bit.sum(idx);
            int currentPos = idx - removedBefore;
            swaps += currentPos - i;
            bit.add(idx, 1);
        }
        return swaps;
    }

    private static class Fenwick {
        private final int n;
        private final int[] tree;

        Fenwick(int n) {
            this.n = n;
            this.tree = new int[n + 1];
        }

        void add(int idx, int delta) {
            for (int i = idx + 1; i <= n; i += i & -i) {
                tree[i] += delta;
            }
        }

        int sum(int idx) {
            int res = 0;
            for (int i = idx + 1; i > 0; i -= i & -i) {
                res += tree[i];
            }
            return res;
        }
    }
}

