import java.util.*;

public class Solution {
    private static final long MOD = 1_000_000_007L;

    public int makeStringSorted(String s) {
        int n = s.length();
        int[] freq = new int[256];
        for (int i = 0; i < n; i++) {
            freq[s.charAt(i)]++;
        }

        long[] fact = new long[n + 1];
        long[] invFact = new long[n + 1];
        fact[0] = 1;
        for (int i = 1; i <= n; i++) {
            fact[i] = fact[i - 1] * i % MOD;
        }
        invFact[n] = modInverse(fact[n], MOD);
        for (int i = n - 1; i >= 0; i--) {
            invFact[i] = invFact[i + 1] * (i + 1) % MOD;
        }

        long denom = 1;
        for (int i = 0; i < 256; i++) {
            denom = denom * invFact[freq[i]] % MOD;
        }

        long rank = 0;
        for (int i = 0; i < n; i++) {
            int idx = s.charAt(i);
            int smallerSum = 0;
            for (int c = 0; c < idx; c++) {
                smallerSum += freq[c];
            }
            if (smallerSum > 0) {
                long add = fact[n - i - 1] * denom % MOD * smallerSum % MOD;
                rank = (rank + add) % MOD;
            }

            int cnt = freq[idx];
            denom = denom * fact[cnt] % MOD * invFact[cnt - 1] % MOD;
            freq[idx]--;
        }

        return (int) rank;
    }

    private long modInverse(long a, long mod) {
        long res = 1;
        long exp = mod - 2;
        long base = a % mod;
        while (exp > 0) {
            if ((exp & 1) == 1) {
                res = res * base % mod;
            }
            base = base * base % mod;
            exp >>= 1;
        }
        return res;
    }
}

