public class Solution {
    public int minFlips(String s) {
        int n = s.length();
        int zerosParity0 = 0, onesParity0 = 0;
        int zerosParity1 = 0, onesParity1 = 0;

        for (int i = 0; i < n; i++) {
            char c = s.charAt(i);
            if ((i & 1) == 0) { // even index
                if (c == '0') zerosParity0++;
                else onesParity0++;
            } else { // odd index
                if (c == '0') zerosParity1++;
                else onesParity1++;
            }
        }

        int m1 = onesParity0 + zerosParity1; // pattern "0101..." with shift parity 0
        int m2 = onesParity1 + zerosParity0; // pattern "0101..." with shift parity 1
        int m3 = zerosParity0 + onesParity1; // pattern "1010..." with shift parity 0
        int m4 = zerosParity1 + onesParity0; // pattern "1010..." with shift parity 1

        return Math.min(Math.min(m1, m2), Math.min(m3, m4));
    }
}

