public class Solution {
    public int minSwaps(String s) {
        int n = s.length();
        int count0 = 0, count1 = 0;
        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == '0') count0++;
            else count1++;
        }

        if (Math.abs(count0 - count1) > 1) return -1;

        int mismatchesStartWith0 = 0;
        int mismatchesStartWith1 = 0;

        for (int i = 0; i < n; i++) {
            char expected0 = (i % 2 == 0) ? '0' : '1';
            char expected1 = (i % 2 == 0) ? '1' : '0';
            if (s.charAt(i) != expected0) mismatchesStartWith0++;
            if (s.charAt(i) != expected1) mismatchesStartWith1++;
        }

        if (count0 > count1) {
            return mismatchesStartWith0;
        } else if (count1 > count0) {
            return mismatchesStartWith1;
        } else {
            return Math.min(mismatchesStartWith0, mismatchesStartWith1);
        }
    }
}

