import java.util.Arrays;
import java.util.TreeSet;

public class Solution {
    public int[] closestRoom(int[][] rooms, int[][] queries) {
        int n = rooms.length;
        int k = queries.length;

        // Sort rooms by size descending
        Arrays.sort(rooms, (a, b) -> Integer.compare(b[1], a[1]));

        // Prepare queries with original indices
        Query[] qs = new Query[k];
        for (int i = 0; i < k; i++) {
            qs[i] = new Query(queries[i][0], queries[i][1], i);
        }
        // Sort queries by minSize descending
        Arrays.sort(qs, (a, b) -> Integer.compare(b.minSize, a.minSize));

        int[] ans = new int[k];
        TreeSet<Integer> ids = new TreeSet<>();
        int roomIdx = 0;

        for (Query q : qs) {
            // Add all rooms with size >= q.minSize
            while (roomIdx < n && rooms[roomIdx][1] >= q.minSize) {
                ids.add(rooms[roomIdx][0]);
                roomIdx++;
            }

            if (ids.isEmpty()) {
                ans[q.idx] = -1;
                continue;
            }

            Integer floor = ids.floor(q.preferred);
            Integer ceil = ids.ceiling(q.preferred);

            if (floor == null) {
                ans[q.idx] = ceil;
            } else if (ceil == null) {
                ans[q.idx] = floor;
            } else {
                int diffFloor = q.preferred - floor;
                int diffCeil = ceil - q.preferred;
                if (diffFloor <= diffCeil) {
                    ans[q.idx] = floor;
                } else {
                    ans[q.idx] = ceil;
                }
            }
        }

        return ans;
    }

    private static class Query {
        int preferred;
        int minSize;
        int idx;

        Query(int preferred, int minSize, int idx) {
            this.preferred = preferred;
            this.minSize = minSize;
            this.idx = idx;
        }
    }
}

