        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c == '1') {
                currentOnes++;
                currentZeros = 0;
                if (currentOnes > maxOnes) {
                    maxOnes = currentOnes;
                }
            } else if (c == '0') {
                currentZeros++;
                currentOnes = 0;
                if (currentZeros > maxZeros) {
                    maxZeros = currentZeros;
                }
            } else {
                // ignore any other characters
                currentOnes = 0;
                currentZeros = 0;
            }
        }
        return maxOnes > maxZeros;
    }
