public class Solution {
    public int rearrangeSticks(int n, int k) {
        final long MOD = 1_000_000_007L;
        if (k > n) return 0;
        long[][] dp = new long[n + 1][k + 1];
        dp[0][0] = 1;
        for (int i = 1; i <= n; i++) {
            int maxJ = Math.min(i, k);
            for (int j = 1; j <= maxJ; j++) {
                dp[i][j] = (dp[i - 1][j - 1] + (long) (i - 1) * dp[i - 1][j]) % MOD;
            }
        }
        return (int) dp[n][k];
    }
}

