import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int maxHappyGroups(int batchSize, int[] groups) {
        int[] freq = new int[batchSize];
        for (int g : groups) {
            freq[g % batchSize]++;
        }
        int baseHappy = freq[0];
        int[] counts = new int[batchSize];
        for (int i = 1; i < batchSize; i++) {
            counts[i] = freq[i];
        }
        long initialState = encode(counts, batchSize);
        Map<Long, Integer>[] memo = new HashMap[batchSize];
        for (int i = 0; i < batchSize; i++) {
            memo[i] = new HashMap<>();
        }
        int extra = dfs(initialState, 0, batchSize, memo);
        return baseHappy + extra;
    }

    private long encode(int[] counts, int batchSize) {
        long state = 0L;
        for (int i = 1; i < batchSize; i++) {
            int shift = 7 * (i - 1);
            state |= ((long) counts[i]) << shift;
        }
        return state;
    }

    private int getCount(long state, int r, int batchSize) {
        int shift = 7 * (r - 1);
        return (int) ((state >> shift) & 0x7FL);
    }

    private long decrement(long state, int r, int batchSize) {
        int shift = 7 * (r - 1);
        return state - (1L << shift);
    }

    private int dfs(long state, int prevRemainder, int batchSize, Map<Long, Integer>[] memo) {
        if (state == 0) {
            return 0;
        }
        Integer cached = memo[prevRemainder].get(state);
        if (cached != null) {
            return cached;
        }
        int best = 0;
        for (int r = 1; r < batchSize; r++) {
            int cnt = getCount(state, r, batchSize);
            if (cnt > 0) {
                long newState = decrement(state, r, batchSize);
                int newPrev = (prevRemainder + r) % batchSize;
                int add = (newPrev == 0) ? 1 : 0;
                int candidate = add + dfs(newState, newPrev, batchSize, memo);
                if (candidate > best) {
                    best = candidate;
                }
            }
        }
        memo[prevRemainder].put(state, best);
        return best;
    }
}

