import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public int[] minInterval(int[][] intervals, int[] queries) {
        int n = queries.length;
        int[] ans = new int[n];

        // Pair queries with original indices
        int[][] qPairs = new int[n][2];
        for (int i = 0; i < n; i++) {
            qPairs[i][0] = queries[i];
            qPairs[i][1] = i;
        }
        Arrays.sort(qPairs, Comparator.comparingInt(a -> a[0]));

        // Sort intervals by left endpoint
        Arrays.sort(intervals, Comparator.comparingInt(a -> a[0]));

        // Min-heap ordered by interval length
        PriorityQueue<int[]> pq = new PriorityQueue<>(Comparator.comparingInt(a -> a[2])); // [left, right, length]

        int idx = 0;
        for (int[] q : qPairs) {
            int val = q[0];
            int origIdx = q[1];

            // Add all intervals whose left <= val
            while (idx < intervals.length && intervals[idx][0] <= val) {
                int left = intervals[idx][0];
                int right = intervals[idx][1];
                int len = right - left + 1;
                pq.offer(new int[]{left, right, len});
                idx++;
            }

            // Remove intervals that end before val
            while (!pq.isEmpty() && pq.peek()[1] < val) {
                pq.poll();
            }

            ans[origIdx] = pq.isEmpty() ? -1 : pq.peek()[2];
        }

        return ans;
    }
}

