public class Solution {
    public int maximumPopulation(int[][] logs) {
        // The problem guarantees that birth and death years are between 1 and 100 inclusive.
        // We use a difference array to efficiently compute population counts for each year.
        int[] diff = new int[101]; // indices 0..100, we ignore index 0

        for (int[] log : logs) {
            int birth = log[0];
            int death = log[1];
            diff[birth]++;      // person becomes alive at birth year
            diff[death]--;      // person dies before death year, so not counted in death year
        }

        int maxPop = -1;
        int yearWithMax = 0;
        int currentPop = 0;

        for (int year = 1; year <= 100; year++) {
            currentPop += diff[year];
            if (currentPop > maxPop) {
                maxPop = currentPop;
                yearWithMax = year;
            }
        }

        return yearWithMax;
    }
}

