import java.util.Arrays;
import java.util.Comparator;

public class Solution {
    public int maxBuilding(int n, int[][] restrictions) {
        // Add the implicit restriction for building 1 with height 0
        int[][] all = new int[restrictions.length + 1][2];
        all[0][0] = 1;
        all[0][1] = 0;
        for (int i = 0; i < restrictions.length; i++) {
            all[i + 1][0] = restrictions[i][0];
            all[i + 1][1] = restrictions[i][1];
        }

        // Sort by building id
        Arrays.sort(all, Comparator.comparingInt(a -> a[0]));

        int m = all.length;

        // Forward pass: ensure each restriction does not exceed the previous one + distance
        for (int i = 1; i < m; i++) {
            int dist = all[i][0] - all[i - 1][0];
            all[i][1] = Math.min(all[i][1], all[i - 1][1] + dist);
        }

        // Backward pass: ensure each restriction does not exceed the next one + distance
        for (int i = m - 2; i >= 0; i--) {
            int dist = all[i + 1][0] - all[i][0];
            all[i][1] = Math.min(all[i][1], all[i + 1][1] + dist);
        }

        long answer = 0;

        // Compute maximum height between consecutive restrictions
        for (int i = 0; i < m - 1; i++) {
            int id1 = all[i][0];
            int h1 = all[i][1];
            int id2 = all[i + 1][0];
            int h2 = all[i + 1][1];
            int dist = id2 - id1;
            int diff = Math.abs(h2 - h1);
            int peak = Math.max(h1, h2) + (dist - diff) / 2;
            answer = Math.max(answer, peak);
        }

        // Consider the segment from the last restriction to building n
        int lastId = all[m - 1][0];
        int lastH = all[m - 1][1];
        answer = Math.max(answer, lastH + (n - lastId));

        return (int) answer;
    }
}

