public class Solution {
    public char[][] rotateTheBox(char[][] box) {
        int m = box.length;
        int n = box[0].length;
        char[][] rotated = new char[n][m];
        // Rotate 90 degrees clockwise
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                rotated[j][m - 1 - i] = box[i][j];
            }
        }
        // Simulate gravity for stones ('#') with obstacles ('O')
        for (int col = 0; col < n; col++) {
            int pointer = m - 1; // lowest empty position for a stone
            for (int row = m - 1; row >= 0; row--) {
                char cell = rotated[row][col];
                if (cell == 'O') {
                    pointer = row - 1; // stones cannot go below this obstacle
                } else if (cell == '#') {
                    if (pointer != row) {
                        rotated[pointer][col] = '#';
                        rotated[row][col] = '.';
                    }
                    pointer--; // next stone will settle above this one
                }
            }
        }
        return rotated;
    }
}

