public class Solution {
    public int maxValue(int n, int index, int maxSum) {
        long leftLen = index;
        long rightLen = n - index - 1;
        long low = 1, high = maxSum, ans = 1;
        while (low <= high) {
            long mid = (low + high) >>> 1;
            if (isFeasible(mid, leftLen, rightLen, maxSum)) {
                ans = mid;
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }
        return (int) ans;
    }

    private boolean isFeasible(long peak, long leftLen, long rightLen, long maxSum) {
        long sum = peak;
        sum += calcSideSum(peak, leftLen);
        sum += calcSideSum(peak, rightLen);
        return sum <= maxSum;
    }

    private long calcSideSum(long peak, long len) {
        if (len == 0) return 0;
        if (peak > len) {
            long first = peak - 1;
            long last = peak - len;
            return (first + last) * len / 2;
        } else {
            long first = peak - 1;
            long last = 1;
            long decreasingSum = (first + last) * first / 2;
            long ones = len - first;
            return decreasingSum + ones;
        }
    }
}

