import java.util.Arrays;

public class Solution {
    public int minimumXORSum(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int fullMask = (1 << n) - 1;
        int[] dp = new int[1 << n];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[0] = 0;

        for (int mask = 0; mask <= fullMask; mask++) {
            int i = Integer.bitCount(mask); // index of next element in nums1
            if (i >= n) continue;
            for (int j = 0; j < n; j++) {
                if ((mask & (1 << j)) == 0) {
                    int newMask = mask | (1 << j);
                    int val = dp[mask] + (nums1[i] ^ nums2[j]);
                    if (val < dp[newMask]) {
                        dp[newMask] = val;
                    }
                }
            }
        }
        return dp[fullMask];
    }
}

