import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public int[] getOrder(int[][] tasks1) {
        int n = tasks1.length;
        int[][] tasks = new int[n][3];
        for (int i = 0; i < n; i++) {
            tasks[i][0] = tasks1[i][0]; // enqueueTime
            tasks[i][1] = tasks1[i][1]; // processingTime
            tasks[i][2] = i;            // original index
        }

        // Sort tasks by enqueueTime
        Arrays.sort(tasks, Comparator.comparingInt(a -> a[0]));

        // Priority queue: first by processingTime, then by index
        PriorityQueue<int[]> pq = new PriorityQueue<>(
                Comparator.comparingInt((int[] a) -> a[1]).thenComparingInt(a -> a[2]));

        int[] result = new int[n];
        int pos = 0;          // position in result
        int idx = 0;          // index in sorted tasks
        long time = 0;        // current time

        while (pos < n) {
            // Add all tasks that have arrived by current time
            while (idx < n && tasks[idx][0] <= time) {
                pq.offer(tasks[idx]);
                idx++;
            }

            if (!pq.isEmpty()) {
                int[] cur = pq.poll();
                time += cur[1];          // finish time of current task
                result[pos++] = cur[2];  // original index
            } else {
                // If no task is available, jump to next task's enqueueTime
                time = tasks[idx][0];
            }
        }

        return result;
    }
}

