import java.util.HashSet;
import java.util.PriorityQueue;
import java.util.Set;

public class Solution {
    public int[] getBiggestThree(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        Set<Integer> sums = new HashSet<>();

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                int maxR = Math.min(Math.min(i, m - 1 - i), Math.min(j, n - 1 - j));
                for (int r = 0; r <= maxR; r++) {
                    if (r == 0) {
                        sums.add(grid[i][j]);
                    } else {
                        int sum = 0;
                        // top side
                        for (int s = 0; s <= r; s++) {
                            sum += grid[i - s][j];
                        }
                        // top-right side
                        for (int s = 1; s <= r; s++) {
                            sum += grid[i - s][j + s];
                        }
                        // bottom-right side
                        for (int s = 1; s <= r; s++) {
                            sum += grid[i + s][j + s];
                        }
                        // bottom-left side
                        for (int s = 1; s <= r; s++) {
                            sum += grid[i + s][j - s];
                        }
                        // top-left side
                        for (int s = 1; s <= r; s++) {
                            sum += grid[i - s][j - s];
                        }
                        sums.add(sum);
                    }
                }
            }
        }

        PriorityQueue<Integer> minHeap = new PriorityQueue<>(3);
        for (int val : sums) {
            if (minHeap.size() < 3) {
                minHeap.offer(val);
            } else if (val > minHeap.peek()) {
                minHeap.poll();
                minHeap.offer(val);
            }
        }

        int size = minHeap.size();
        int[] result = new int[size];
        for (int idx = size - 1; idx >= 0; idx--) {
            result[idx] = minHeap.poll();
        }
        return result;
    }
}

