public class Solution {
    public int minSkips(int[] dist, int speed, int hoursBefore) {
        int n = dist.length;
        double[] travel = new double[n];
        for (int i = 0; i < n; i++) {
            travel[i] = (double) dist[i] / speed;
        }

        double INF = Double.MAX_VALUE / 4;
        double[][] dp = new double[n][n + 1];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i][j] = INF;
            }
        }

        dp[0][0] = travel[0];

        for (int i = 1; i < n; i++) {
            for (int j = 0; j <= i; j++) {
                // Case 1: no skip after previous road
                if (dp[i - 1][j] < INF) {
                    double time = dp[i - 1][j] + Math.ceil(travel[i - 1]) + travel[i];
                    if (time < dp[i][j]) dp[i][j] = time;
                }
                // Case 2: skip after previous road
                if (j > 0 && dp[i - 1][j - 1] < INF) {
                    double time = dp[i - 1][j - 1] + travel[i - 1] + travel[i];
                    if (time < dp[i][j]) dp[i][j] = time;
                }
            }
        }

        for (int skips = 0; skips <= n; skips++) {
            if (dp[n - 1][skips] <= hoursBefore) {
                return skips;
            }
        }
        return -1;
    }
}

