public class Solution {
    private static class TrieNode {
        TrieNode[] child = new TrieNode[2];
        int count = 0;
    }

    private final TrieNode root = new TrieNode();

    private void insert(int num) {
        TrieNode node = root;
        for (int bit = 30; bit >= 0; bit--) {
            int b = (num >> bit) & 1;
            if (node.child[b] == null) {
                node.child[b] = new TrieNode();
            }
            node = node.child[b];
            node.count++;
        }
    }

    private int countLessOrEqual(int num, int x) {
        if (x < 0) return 0;
        TrieNode node = root;
        int res = 0;
        for (int bit = 30; bit >= 0; bit--) {
            if (node == null) break;
            int nBit = (num >> bit) & 1;
            int xBit = (x >> bit) & 1;
            if (xBit == 1) {
                TrieNode same = node.child[nBit];
                if (same != null) res += same.count;
                node = node.child[1 - nBit];
            } else {
                node = node.child[nBit];
            }
        }
        if (node != null) res += node.count;
        return res;
    }

    public int countPairs(int[] nums, int low, int high) {
        int ans = 0;
        for (int num : nums) {
            ans += countLessOrEqual(num, high) - countLessOrEqual(num, low - 1);
            insert(num);
        }
        return ans;
    }
}

