import java.util.Arrays;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int minWastedSpace(int[] packages, int[][] boxes) {
        int n = packages.length;
        Arrays.sort(packages);
        long[] prefix = new long[n + 1];
        for (int i = 0; i < n; i++) {
            prefix[i + 1] = prefix[i] + packages[i];
        }
        int maxPackage = packages[n - 1];
        long best = Long.MAX_VALUE;

        for (int[] supplier : boxes) {
            if (supplier.length == 0) continue;
            Arrays.sort(supplier);
            // deduplicate
            int uniqSize = 0;
            for (int val : supplier) {
                if (uniqSize == 0 || val != supplier[uniqSize - 1]) {
                    supplier[uniqSize++] = val;
                }
            }
            if (supplier[uniqSize - 1] < maxPackage) continue; // cannot fit largest package

            long wasted = 0;
            int prev = 0;
            for (int i = 0; i < uniqSize; i++) {
                int boxSize = supplier[i];
                int idx = upperBound(packages, boxSize);
                int count = idx - prev;
                long sumPackages = prefix[idx] - prefix[prev];
                wasted += (long) boxSize * count - sumPackages;
                prev = idx;
                if (prev == n) break;
            }
            if (prev < n) continue; // not all packages covered
            if (wasted < best) best = wasted;
        }

        if (best == Long.MAX_VALUE) return -1;
        return (int) (best % MOD);
    }

    private int upperBound(int[] arr, int target) {
        int l = 0, r = arr.length;
        while (l < r) {
