import java.util.Arrays;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int minAbsoluteSumDiff(int[] nums1, int[] nums2) {
        int n = nums1.length;
        long initialSum = 0;
        for (int i = 0; i < n; i++) {
            initialSum += Math.abs((long) nums1[i] - nums2[i]);
        }

        int[] sorted = nums1.clone();
        Arrays.sort(sorted);

        long maxImprovement = 0;
        for (int i = 0; i < n; i++) {
            int target = nums2[i];
            int idx = Arrays.binarySearch(sorted, target);
            int bestDiff = Math.abs((long) nums1[i] - target);

            if (idx >= 0) {
                bestDiff = 0;
            } else {
                idx = -idx - 1;
                if (idx < n) {
                    bestDiff = Math.min(bestDiff, Math.abs((long) sorted[idx] - target));
                }
                if (idx > 0) {
                    bestDiff = Math.min(bestDiff, Math.abs((long) sorted[idx - 1] - target));
                }
            }

            long improvement = Math.abs((long) nums1[i] - target) - bestDiff;
            if (improvement > maxImprovement) {
                maxImprovement = improvement;
            }
        }

        long result = (initialSum - maxImprovement) % MOD;
        return (int) result;
    }
}

