import java.util.ArrayDeque;
import java.util.Deque;

public class Solution {
    public boolean canReach(String s, int minJump, int maxJump) {
        int n = s.length();
        if (n == 1) return true; // already at the end

        boolean[] reachable = new boolean[n];
        reachable[0] = true;

        Deque<Integer> deque = new ArrayDeque<>();
        deque.offerLast(0);

        for (int i = 1; i < n; i++) {
            if (s.charAt(i) == '1') continue; // cannot land here

            // Remove indices that are too far left (outside maxJump window)
            while (!deque.isEmpty() && deque.peekFirst() < i - maxJump) {
                deque.pollFirst();
            }

            // Check if there's a reachable index within [i - maxJump, i - minJump]
            if (!deque.isEmpty() && deque.peekFirst() <= i - minJump) {
                reachable[i] = true;
                deque.offerLast(i);
            }
        }

        return reachable[n - 1];
    }
}

