import java.util.*;

public class Solution {
    public int[] assignTasks(int[] servers, int[] tasks) {
        int n = servers.length;
        int m = tasks.length;
        int[] ans = new int[m];

        // Free servers: sorted by weight, then index
        PriorityQueue<int[]> free = new PriorityQueue<>(Comparator
                .comparingInt((int[] a) -> a[0])   // weight
                .thenComparingInt(a -> a[1]));     // index

        // Busy servers: sorted by finish time, then weight, then index
        PriorityQueue<long[]> busy = new PriorityQueue<>(Comparator
                .comparingLong((long[] a) -> a[0]) // finish time
                .thenComparingInt(a -> (int)a[1]) // weight
                .thenComparingInt(a -> (int)a[2]));// index

        for (int i = 0; i < n; i++) {
            free.offer(new int[]{servers[i], i});
        }

        Queue<Integer> pending = new ArrayDeque<>();
        long currentTime = 0;

        for (int j = 0; j < m; j++) {
            currentTime = Math.max(currentTime, j);
            // Release servers that have finished by currentTime
            while (!busy.isEmpty() && busy.peek()[0] <= currentTime) {
                long[] finished = busy.poll();
                free.offer(new int[]{(int)finished[1], (int)finished[2]});
            }

            // Add current task to pending queue
            pending.offer(j);

            // Assign tasks while possible
            while (!free.isEmpty() && !pending.isEmpty()) {
                int taskIdx = pending.poll();
                int[] server = free.poll();
                int weight = server[0];
                int idx = server[1];
                ans[taskIdx] = idx;
                long finishTime = currentTime + tasks[taskIdx];
                busy.offer(new long[]{finishTime, weight, idx});
            }

            // If no free servers but pending tasks remain, advance time to next finish
            if (free.isEmpty() && !pending.isEmpty()) {
                long nextFinish = busy.peek()[0];
                currentTime = nextFinish;
                // Release servers that finish at this time
                while (!busy.isEmpty() && busy.peek()[0] <= currentTime) {
                    long[] finished = busy.poll();
                    free.offer(new int[]{(int)finished[1], (int)finished[2]});
                }
                // Assign tasks after freeing
                while (!free.isEmpty() && !pending.isEmpty()) {
                    int taskIdx = pending.poll();
                    int[] server = free.poll();
                    int weight = server[0];
                    int idx = server[1];
                    ans[taskIdx] = idx;
                    long finishTime = currentTime + tasks[taskIdx];
                    busy.offer(new long[]{finishTime, weight, idx});
                }
            }
        }

        return ans;
    }
}

