public class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;

        // Prefix sums for rows
        int[][] rowPrefix = new int[m][n + 1];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                rowPrefix[i][j + 1] = rowPrefix[i][j] + grid[i][j];
            }
        }

        // Prefix sums for columns
        int[][] colPrefix = new int[n][m + 1];
        for (int j = 0; j < n; j++) {
            for (int i = 0; i < m; i++) {
                colPrefix[j][i + 1] = colPrefix[j][i] + grid[i][j];
            }
        }

        int maxSide = Math.min(m, n);
        for (int k = maxSide; k >= 1; k--) {
            for (int i = 0; i + k <= m; i++) {
                for (int j = 0; j + k <= n; j++) {
                    int target = rowPrefix[i][j + k] - rowPrefix[i][j];
                    boolean ok = true;

                    // Check all rows
                    for (int r = 0; r < k; r++) {
                        if (rowPrefix[i + r][j + k] - rowPrefix[i + r][j] != target) {
                            ok = false;
                            break;
                        }
                    }
                    if (!ok) continue;

                    // Check all columns
                    for (int c = 0; c < k; c++) {
                        if (colPrefix[j + c][i + k] - colPrefix[j + c][i] != target) {
                            ok = false;
                            break;
                        }
                    }
                    if (!ok) continue;

                    // Check main diagonal
                    int diag1 = 0;
                    for (int d = 0; d < k; d++) {
                        diag1 += grid[i + d][j + d];
                    }
                    if (diag1 != target) continue;

                    // Check anti-diagonal
                    int diag2 = 0;
                    for (int d = 0; d < k; d++) {
                        diag2 += grid[i + d][j + k - 1 - d];
                    }
                    if (diag2 != target) continue;

                    return k;
                }
            }
        }
        return 1;
    }
}

