public class Solution {
    private static final long MOD = 1_000_000_007L;

    public long maxNiceDivisors(int primeFactors) {
        if (primeFactors <= 3) {
            return primeFactors;
        }
        long count3 = primeFactors / 3;
        int rem = primeFactors % 3;
        long result;
        if (rem == 0) {
            result = powMod(3, count3, MOD);
        } else if (rem == 1) {
            result = powMod(3, count3 - 1, MOD);
            result = (result * 4) % MOD;
        } else { // rem == 2
            result = powMod(3, count3, MOD);
            result = (result * 2) % MOD;
        }
        return result;
    }

    private long powMod(long base, long exp, long mod) {
        long res = 1;
        base %= mod;
        while (exp > 0) {
            if ((exp & 1) == 1) {
                res = (res * base) % mod;
            }
            base = (base * base) % mod;
            exp >>= 1;
        }
        return res;
    }
}

