        int pIdx = 0;
        int pLen = p.length();
        for (int i = 0; i < s.length() && pIdx < pLen; i++) {
            if (removalTime[i] >= k && s.charAt(i) == p.charAt(pIdx)) {
                pIdx++;
            }
        }
        return pIdx == pLen;
    }
}

