public class Solution {
    public int reinitializePermutation(int n) {
        boolean[] visited = new boolean[n];
        long lcm = 1;
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                int len = 0;
                int cur = i;
                do {
                    visited[cur] = true;
                    cur = nextIndex(cur, n);
                    len++;
                } while (cur != i);
                lcm = lcm(lcm, len);
            }
        }
        return (int) lcm;
    }

    private int nextIndex(int idx, int n) {
        if (idx < n / 2) {
            return 2 * idx;
        } else {
            return 2 * (idx - n / 2) + 1;
        }
    }

    private long gcd(long a, long b) {
        while (b != 0) {
            long t = a % b;
            a = b;
            b = t;
        }
        return a;
    }

    private long lcm(long a, long b) {
        return a / gcd(a, b) * b;
    }
}

