public class Solution {
    public int minSideJumps(int[] obstacles) {
        int n = obstacles.length - 1;
        final int INF = 1_000_000;
        int[] dp = new int[3];
        dp[0] = INF; // lane 1
        dp[1] = 0;   // lane 2 (start)
        dp[2] = INF; // lane 3

        for (int i = 1; i < n; i++) {
            // Remove lanes blocked at current point i
            if (obstacles[i] != 0) {
                int blockedLane = obstacles[i] - 1; // 0-based
                dp[blockedLane] = INF;
            }

            // Compute minimal side jumps to each lane at point i
            int[] newDp = new int[3];
            for (int lane = 0; lane < 3; lane++) {
                if (dp[lane] == INF) {
                    newDp[lane] = INF;
                    continue;
                }
                int best = dp[lane];
                for (int other = 0; other < 3; other++) {
                    if (other == lane) continue;
                    if (dp[other] + 1 < best) {
                        best = dp[other] + 1;
                    }
                }
                newDp[lane] = best;
            }
            dp = newDp;
        }

        // After processing up to point n-1, answer is min over lanes at point n
        int result = Math.min(dp[0], Math.min(dp[1], dp[2]));
        return result;
    }
}

