import java.math.BigInteger;

public class Solution {
    public boolean splitString(String s) {
        return dfs(s, 0, null, 0);
    }

    private boolean dfs(String s, int index, BigInteger prev, int count) {
        int n = s.length();
        if (index == n) {
            return count >= 2;
        }

        // Try all possible next substrings
        for (int len = 1; len <= n - index; len++) {
            String sub = s.substring(index, index + len);
            BigInteger cur = new BigInteger(sub);

            if (prev == null) {
                // First substring, just proceed
                if (dfs(s, index + len, cur, count + 1)) {
                    return true;
                }
            } else {
                BigInteger expected = prev.subtract(BigInteger.ONE);
                if (cur.equals(expected)) {
                    if (dfs(s, index + len, cur, count + 1)) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

