import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int shortestPathAllKeys(String[] stringGrid) {
        int m = stringGrid.length;
        int n = stringGrid[0].length();
        char[][] grid = new char[m][n];
        int startX = -1, startY = -1;
        int keyCount = 0;

        for (int i = 0; i < m; i++) {
            String row = stringGrid[i];
            for (int j = 0; j < n; j++) {
                char c = row.charAt(j);
                grid[i][j] = c;
                if (c == '@') {
                    startX = i;
                    startY = j;
                } else if (c >= 'a' && c <= 'f') {
                    keyCount++;
                }
            }
        }

        if (keyCount == 0) {
            return 0;
        }

        int allKeysMask = (1 << keyCount) - 1;
        boolean[][][] visited = new boolean[m][n][1 << keyCount];
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{startX, startY, 0, 0});
        visited[startX][startY][0] = true;

        int[][] dirs = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};

        while (!queue.isEmpty()) {
            int[] cur = queue.poll();
            int x = cur[0], y = cur[1], mask = cur[2], steps = cur[3];

            for (int[] d : dirs) {
                int nx = x + d[0];
                int ny = y + d[1];
                if (nx < 0 || nx >= m || ny < 0 || ny >= n) continue;
                char cell = grid[nx][ny];
                if (cell == '#') continue;

                int newMask = mask;
                if (cell >= 'a' && cell <= 'f') {
                    int bit = cell - 'a';
                    newMask = mask | (1 << bit);
                }
                if (cell >= 'A' && cell <= 'F') {
                    int bit = cell - 'A';
                    if ((mask & (1 << bit)) == 0) {
                        continue; // lock without key
                    }
                }

                if (visited[nx][ny][newMask]) continue;
                if (newMask == allKeysMask) {
                    return steps + 1;
                }
                visited[nx][ny][newMask] = true;
                queue.offer(new int[]{nx, ny, newMask, steps + 1});
            }
        }

        return -1;
    }
}

