import java.util.ArrayDeque;
import java.util.ArrayList;
import java.util.Queue;

public class Solution {
    public int largestPathValue(String colors, int[][] edges) {
        int n = colors.length();
        ArrayList<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        int[] indegree = new int[n];
        for (int[] e : edges) {
            int a = e[0], b = e[1];
            graph[a].add(b);
            indegree[b]++;
        }

        int[][] dp = new int[n][26];
        Queue<Integer> q = new ArrayDeque<>();
        for (int i = 0; i < n; i++) {
            if (indegree[i] == 0) {
                q.offer(i);
                dp[i][colors.charAt(i) - 'a'] = 1;
            }
        }

        int processed = 0;
        int answer = 0;
        while (!q.isEmpty()) {
            int u = q.poll();
            processed++;

            // Update answer with the maximum color count at node u
            for (int c = 0; c < 26; c++) {
                if (dp[u][c] > answer) {
                    answer = dp[u][c];
                }
            }

            for (int v : graph[u]) {
                for (int c = 0; c < 26; c++) {
                    if (dp[u][c] == 0) continue;
                    int val = dp[u][c] + (colors.charAt(v) - 'a' == c ? 1 : 0);
                    if (val > dp[v][c]) {
                        dp[v][c] = val;
                    }
                }
                indegree[v]--;
                if (indegree[v] == 0) {
                    q.offer(v);
                }
            }
        }

        if (processed < n) {
            return -1; // cycle detected
        }
        return answer;
    }
}

