            } else {
                int sum = 0;
                while (!stack.isEmpty() && stack.peek() != 0) {
                    sum += stack.pop();
                }
                if (!stack.isEmpty()) {
                    stack.pop(); // remove the matching '(' marker
                }
                int val = sum == 0 ? 1 : 2 * sum;
                stack.push(val);
            }
        }
        int result = 0;
        while (!stack.isEmpty()) {
            result += stack.pop();
        }
        return result;
    }
}

