import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> splitIntoFibonacci(String num) {
        List<Integer> result = new ArrayList<>();
        backtrack(num, 0, result);
        return result;
    }

    private boolean backtrack(String num, int start, List<Integer> seq) {
        if (start == num.length()) {
            return seq.size() >= 3;
        }

        long current = 0;
        for (int end = start + 1; end <= num.length(); end++) {
            // Leading zero check
            if (num.charAt(start) == '0' && end - start > 1) {
                break;
            }

            current = current * 10 + (num.charAt(end - 1) - '0');
            if (current > Integer.MAX_VALUE) {
                break;
            }

            int size = seq.size();
            if (size >= 2) {
                long sum = (long) seq.get(size - 2) + seq.get(size - 1);
                if (current < sum) {
                    continue;
                } else if (current > sum) {
                    break;
                }
            }

            seq.add((int) current);
            if (backtrack(num, end, seq)) {
                return true;
            }
            seq.remove(seq.size() - 1);
        }
        return false;
    }
}

