public class Solution {
    public int binaryGap(int n) {
        int maxGap = 0;
        int lastOnePos = -1;
        int pos = 0;
        while (n > 0) {
            if ((n & 1) == 1) {
                if (lastOnePos != -1) {
                    int gap = pos - lastOnePos;
                    if (gap > maxGap) {
                        maxGap = gap;
                    }
                }
                lastOnePos = pos;
            }
            n >>= 1;
            pos++;
        }
        return maxGap;
    }
}

