public class Solution {
    public int[] loudAndRich(int[][] richer, int[] quiet) {
        int n = quiet.length;
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] pair : richer) {
            int richerPerson = pair[0];
            int poorerPerson = pair[1];
            graph[richerPerson].add(poorerPerson);
        }

        int[] answer = new int[n];
        for (int i = 0; i < n; i++) {
            answer[i] = -1;
        }

        for (int i = 0; i < n; i++) {
            dfs(i, graph, quiet, answer);
        }

        return answer;
    }

    private int dfs(int node, List<Integer>[] graph, int[] quiet, int[] answer) {
        if (answer[node] != -1) {
            return answer[node];
        }
        int minQuietNode = node;
        for (int neighbor : graph[node]) {
            int candidate = dfs(neighbor, graph, quiet, answer);
            if (quiet[candidate] < quiet[minQuietNode]) {
                minQuietNode = candidate;
            }
        }
        answer[node] = minQuietNode;
        return minQuietNode;
    }
}

