import java.util.*;

public class Solution {
    public boolean splitArraySameAverage(int[] nums) {
        int n = nums.length;
        if (n <= 1) return false;

        int totalSum = 0;
        for (int num : nums) totalSum += num;

        // dp[k][s] == true if a subset of size k with sum s exists
        boolean[][] dp = new boolean[n + 1][totalSum + 1];
        dp[0][0] = true;

        for (int num : nums) {
            // iterate k in reverse to avoid reuse of the same element
            for (int k = n - 1; k >= 0; k--) {
                for (int s = 0; s <= totalSum - num; s++) {
                    if (dp[k][s]) {
                        dp[k + 1][s + num] = true;
                    }
                }
            }
        }

        for (int k = 1; k < n; k++) {
            if ((totalSum * k) % n != 0) continue;
            int target = (totalSum * k) / n;
            if (dp[k][target]) return true;
        }
        return false;
    }
}

