import java.util.*;

public class Solution {
    public double largestSumOfAverages(int[] nums, int k) {
        int n = nums.length;
        int maxParts = Math.min(k, n);
        double[] prefix = new double[n + 1];
        for (int i = 0; i < n; i++) {
            prefix[i + 1] = prefix[i] + nums[i];
        }

        double[][] dp = new double[n + 1][maxParts + 1];
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= Math.min(i, maxParts); j++) {
                double best = 0.0;
                for (int t = j - 1; t < i; t++) {
                    double avg = (prefix[i] - prefix[t]) / (i - t);
                    best = Math.max(best, dp[t][j - 1] + avg);
                }
                dp[i][j] = best;
            }
        }
        return dp[n][maxParts];
    }
}

