public class Solution {
    public String decodeAtIndex(String s, int k) {
        long len = 0;
        // First pass: compute the length of the decoded string
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (Character.isDigit(c)) {
                int d = c - '0';
                len = Math.min(len * d, (long) k + 1); // cap to avoid overflow
            } else {
                len++;
            }
        }

        // Second pass: find the k-th character by iterating backwards
        for (int i = s.length() - 1; i >= 0; i--) {
            char c = s.charAt(i);
            if (Character.isDigit(c)) {
                int d = c - '0';
                len /= d;
                k %= len;
            } else {
                if (k == 0 || k == len) {
                    return String.valueOf(c);
                }
                len--;
            }
        }
        return ""; // should never reach here
    }
}

