import java.util.HashSet;
import java.util.LinkedList;
import java.util.Queue;
import java.util.Set;

public class Solution {
    public int racecar(int target) {
        if (target == 0) return 0;
        Queue<int[]> queue = new LinkedList<>();
        Set<Long> visited = new HashSet<>();

        queue.offer(new int[]{0, 1});
        visited.add(((long) 0 << 32) ^ (1 & 0xffffffffL));

        int steps = 0;
        int limit = 2 * target;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] cur = queue.poll();
                int pos = cur[0];
                int speed = cur[1];

                if (pos == target) return steps;

                // Accelerate
                int newPos = pos + speed;
                int newSpeed = speed * 2;
                long keyA = ((long) newPos << 32) ^ (newSpeed & 0xffffffffL);
                if (Math.abs(newPos) <= limit && !visited.contains(keyA)) {
                    visited.add(keyA);
                    queue.offer(new int[]{newPos, newSpeed});
                }

                // Reverse
                int revSpeed = speed > 0 ? -1 : 1;
                long keyR = ((long) pos << 32) ^ (revSpeed & 0xffffffffL);
                if (!visited.contains(keyR)) {
                    visited.add(keyR);
                    queue.offer(new int[]{pos, revSpeed});
                }
            }
            steps++;
        }
        return -1; // Should never reach here for valid input
    }
}

