import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int lenLongestFibSubseq(int[] arr) {
        int n = arr.length;
        if (n < 3) return 0;

        Map<Integer, Integer> index = new HashMap<>();
        for (int i = 0; i < n; i++) {
            index.put(arr[i], i);
        }

        int[][] dp = new int[n][n];
        int maxLen = 0;

        for (int j = 0; j < n; j++) {
            for (int k = j + 1; k < n; k++) {
                int needed = arr[k] - arr[j];
                Integer i = index.get(needed);
                if (i != null && i < j) {
                    dp[j][k] = dp[i][j] + 1;
                } else {
                    dp[j][k] = 2; // minimal length of a Fibonacci-like subsequence
                }
                if (dp[j][k] > maxLen) {
                    maxLen = dp[j][k];
                }
            }
        }

        return maxLen > 2 ? maxLen : 0;
    }
}

