import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        if (preorder == null || postorder == null || preorder.length == 0) {
            return null;
        }
        Map<Integer, Integer> postIndexMap = new HashMap<>();
        for (int i = 0; i < postorder.length; i++) {
            postIndexMap.put(postorder[i], i);
        }
        return build(preorder, 0, preorder.length - 1,
                     postorder, 0, postorder.length - 1,
                     postIndexMap);
    }

    private TreeNode build(int[] pre, int preStart, int preEnd,
                           int[] post, int postStart, int postEnd,
                           Map<Integer, Integer> postIndexMap) {
        if (preStart > preEnd) {
            return null;
        }
        TreeNode root = new TreeNode(pre[preStart]);
        if (preStart == preEnd) {
            return root;
        }
        int leftRootVal = pre[preStart + 1];
        int leftRootIndexInPost = postIndexMap.get(leftRootVal);
        int leftSize = leftRootIndexInPost - postStart + 1;

        root.left = build(pre, preStart + 1, preStart + leftSize,
                          post, postStart, leftRootIndexInPost,
                          postIndexMap);
        root.right = build(pre, preStart + leftSize + 1, preEnd,
                           post, leftRootIndexInPost + 1, postEnd - 1,
                           postIndexMap);
        return root;
    }
}

