public class Solution {
    public void findSecretWord(String[] wordlist, Master master) {
        List<String> candidates = new ArrayList<>(Arrays.asList(wordlist));
        Random rand = new Random();
        for (int i = 0; i < 10 && !candidates.isEmpty(); i++) {
            String guess = candidates.get(rand.nextInt(candidates.size()));
            int matches = master.guess(guess);
            if (matches == 6) {
                return;
            }
            List<String> next = new ArrayList<>();
            for (String w : candidates) {
                if (countMatches(w, guess) == matches) {
                    next.add(w);
                }
            }
            candidates = next;
        }
    }

    private int countMatches(String a, String b) {
        int cnt = 0;
        for (int i = 0; i < 6; i++) {
            if (a.charAt(i) == b.charAt(i)) {
                cnt++;
            }
        }
        return cnt;
    }
}

