import java.util.ArrayDeque;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashSet;
import java.util.List;
import java.util.Queue;
import java.util.Set;
import java.util.Map;
import java.util.HashMap;

public class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        if (source == target) return 0;
        int n = routes.length;
        // Map each stop to the list of buses that pass through it
        Map<Integer, List<Integer>> stopToBuses = new HashMap<>();
        for (int i = 0; i < n; i++) {
            for (int stop : routes[i]) {
                stopToBuses.computeIfAbsent(stop, k -> new ArrayList<>()).add(i);
            }
        }
        // BFS over buses
        Queue<Integer> busQueue = new ArrayDeque<>();
        Set<Integer> visitedBuses = new HashSet<>();
        // Initialize with buses that contain the source stop
        List<Integer> startBuses = stopToBuses.getOrDefault(source, new ArrayList<>());
        for (int bus : startBuses) {
            busQueue.offer(bus);
            visitedBuses.add(bus);
        }
        int busesTaken = 1;
        while (!busQueue.isEmpty()) {
            int size = busQueue.size();
            for (int i = 0; i < size; i++) {
                int bus = busQueue.poll();
                for (int stop : routes[bus]) {
                    if (stop == target) return busesTaken;
                    List<Integer> nextBuses = stopToBuses.getOrDefault(stop, new ArrayList<>());
                    for (int nextBus : nextBuses) {
                        if (!visitedBuses.contains(nextBus)) {
                            visitedBuses.add(nextBus);
                            busQueue.offer(nextBus);
                        }
                    }
                }
            }
            busesTaken++;
        }
        return -1;
    }
}

