public class Solution {
    public int mirrorReflection(int p, int q) {
        int g = gcd(p, q);
        long lcm = (long) p / g * q; // avoid overflow
        long m = lcm / p; // horizontal reflections count
        long n = lcm / q; // vertical reflections count

        boolean east = (m % 2 == 1);
        boolean north = (n % 2 == 1);

        if (east && north) return 0;          // NE corner
        if (!east && north) return 1;          // NW corner
        return 2;                              // SE corner
    }

    private int gcd(int a, int b) {
        while (b != 0) {
            int tmp = a % b;
            a = b;
            b = tmp;
        }
        return a;
    }
}

