import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        int n = quality.length;
        // Pair each worker's ratio with its quality
        double[][] workers = new double[n][2];
        for (int i = 0; i < n; i++) {
            workers[i][0] = (double) wage[i] / quality[i]; // ratio
            workers[i][1] = quality[i];
        }
        // Sort by ratio ascending
        Arrays.sort(workers, Comparator.comparingDouble(a -> a[0]));

        PriorityQueue<Double> maxHeap = new PriorityQueue<>(Comparator.reverseOrder());
        double sumQuality = 0.0;
        double minCost = Double.MAX_VALUE;

        for (int i = 0; i < n; i++) {
            double ratio = workers[i][0];
            double q = workers[i][1];
            maxHeap.offer(q);
            sumQuality += q;

            if (maxHeap.size() > k) {
                sumQuality -= maxHeap.poll(); // remove largest quality
            }

            if (maxHeap.size() == k) {
                double cost = sumQuality * ratio;
                if (cost < minCost) {
                    minCost = cost;
                }
            }
        }
        return minCost;
    }
}

