public class Solution {
    public int sumSubseqWidths(int[] nums) {
        int n = nums.length;
        Arrays.sort(nums);
        final long MOD = 1_000_000_007L;
        long[] pow2 = new long[n];
        pow2[0] = 1;
        for (int i = 1; i < n; i++) {
            pow2[i] = (pow2[i - 1] << 1) % MOD;
        }
        long ans = 0;
        for (int i = 0; i < n; i++) {
            long maxCnt = pow2[i];
            long minCnt = pow2[n - 1 - i];
            long diff = (maxCnt - minCnt + MOD) % MOD;
            long val = ((nums[i] % MOD) + MOD) % MOD;
            ans = (ans + val * diff) % MOD;
        }
        return (int) ans;
    }
}

