import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public List<TreeNode> allPossibleFBT(int n) {
        if (n % 2 == 0) {
            return new ArrayList<>();
        }
        Map<Integer, List<TreeNode>> memo = new HashMap<>();
        return build(n, memo);
    }

    private List<TreeNode> build(int n, Map<Integer, List<TreeNode>> memo) {
        if (memo.containsKey(n)) {
            return memo.get(n);
        }

        List<TreeNode> result = new ArrayList<>();

        if (n == 1) {
            result.add(new TreeNode(0));
        } else {
            for (int leftNodes = 1; leftNodes < n; leftNodes += 2) {
                int rightNodes = n - 1 - leftNodes;
                List<TreeNode> leftTrees = build(leftNodes, memo);
                List<TreeNode> rightTrees = build(rightNodes, memo);
                for (TreeNode left : leftTrees) {
                    for (TreeNode right : rightTrees) {
                        TreeNode root = new TreeNode(0, left, right);
                        result.add(root);
                    }
                }
            }
        }

        memo.put(n, result);
        return result;
    }
}

