import java.util.Map;

public class Solution {
    private static final int MOD = 1_000_000_007;

    public int numFactoredBinaryTrees(int[] arr) {
        Arrays.sort(arr);
        int n = arr.length;
        long[] dp = new long[n];
        Map<Integer, Integer> indexMap = new HashMap<>();
        for (int i = 0; i < n; i++) {
            indexMap.put(arr[i], i);
        }

        for (int i = 0; i < n; i++) {
            dp[i] = 1; // single node tree
            for (int j = 0; j < i; j++) {
                int left = arr[j];
                if (arr[i] % left == 0) {
                    int right = arr[i] / left;
                    Integer rightIdx = indexMap.get(right);
                    if (rightIdx != null) {
                        dp[i] = (dp[i] + dp[j] * dp[rightIdx]) % MOD;
                    }
                }
            }
        }

        long result = 0;
        for (long val : dp) {
            result = (result + val) % MOD;
        }
        return (int) result;
    }
}

