public class Solution {
    public int numFriendRequests(int[] ages) {
        int[] freq = new int[121];
        for (int age : ages) {
            if (age >= 0 && age <= 120) {
                freq[age]++;
            }
        }

        int total = 0;
        for (int a = 1; a <= 120; a++) {
            if (freq[a] == 0) continue;

            int lower = Math.max(a / 2 + 1, a - 6);
            int upper = Math.min(120, a);
            if (a < 100) {
                upper = Math.min(upper, 100);
            }

            if (lower > upper) continue;

            int sum = 0;
            for (int b = lower; b <= upper; b++) {
                sum += freq[b];
            }

            // subtract self requests
            total += freq[a] * (sum - freq[a]);
        }

        return total;
    }
}

