import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> eventualSafeNodes(int[][] graph) {
        int n = graph.length;
        int[] state = new int[n]; // 0=unvisited, 1=visiting, 2=safe, 3=unsafe
        List<Integer> result = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            if (isSafe(i, graph, state)) {
                result.add(i);
            }
        }
        return result;
    }

    private boolean isSafe(int node, int[][] graph, int[] state) {
        if (state[node] == 2) return true;
        if (state[node] == 3) return false;
        if (state[node] == 1) return false; // cycle detected

        state[node] = 1; // mark as visiting
        for (int neighbor : graph[node]) {
            if (!isSafe(neighbor, graph, state)) {
                state[node] = 3; // unsafe
                return false;
            }
        }
        state[node] = 2; // safe
        return true;
    }
}
